import  express, {json}  from 'express';
import morgan from 'morgan';

const app = express();

app.set("port", 9999);
app.set("view engine", "jade");
app.use(morgan("dev"));
app.use(json());

app.get("/", (req, res)=> {
	app.send("Hola mundo con  NODEJS");
});

app.listen(app.get("port"), () =>{
	console.log(`Servidor en el puerto: ${app.use("port")}`);
});
